def my_func(input1: str):
    if len(input1) < 1 or len(input1) > 20:
        return ""

    words_list = input1.split()
    result = []

    for words in words_list:
        parts = words.split('-')
        camel_case_word = parts[0] + ''.join(x.capitalize() for x in parts[1:])
        result.append(camel_case_word)

    return ' '.join(result)
